import React from 'react';
import MyPosts from './my-posts';
import ProfileInfo from './profile-info';
import s from './profile.module.css';

const Profile = (props) => {

    return(
        <div>
            <ProfileInfo />
            <MyPosts 
                posts={ props.posts } addPost={ props.addPost }/>
      </div>
    )
};

export default Profile;
